import React from 'react';
import './Search.css';
import './Home.css';

function Search(){
    return (
        <div>
            <div className="ContainerT">
                <h1 className="Title1"> Search </h1>
            </div>
            <div style={{ paddingLeft: "30px" }}>
                <input className="SearchI" />
            </div>

        </div>
    );
}

export default Search;
